import "./App.css";
import "./App.css";
import React , {useState, useEffect} from "react"
import axios from 'axios';
import { TableLabel, TableContainer, Table, Paper, TableHead, TableRow, TableCell, TableBody, makeStyles} from '@material-ui/core';

// I need to useEffect to render the table once automatically so it's not just a blank page. Add a filter by Category .filter() select  Then return the filtered data


const useStyles = makeStyles((theme) => ({
    tableHead: {
        borderBottomStyle: "solid",
        borderBottomColor: "blue"
    },
    stickyHeader:{

    }
}));

function createData(name, calories, fat, carbs, protein) {
    return { name, calories, fat, carbs, protein };
  }

  const rows = [
    createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
    createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
    createData('Eclair', 262, 16.0, 24, 6.0),
    createData('Cupcake', 305, 3.7, 67, 4.3),
    createData('Gingerbread', 356, 16.0, 49, 3.9),
    createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
    createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
    createData('Eclair', 262, 16.0, 24, 6.0),
    createData('Cupcake', 305, 3.7, 67, 4.3),
    createData('Gingerbread', 356, 16.0, 49, 3.9),
  ];

export default function TreatmentTable() {

    const classes = useStyles();

    return (
        <div>
        <TableContainer component={Paper} className={classes.tableContainer}>
       <Table stickyHeader aria-label="simple table">
    <TableHead>
    <TableCell
                style={{
                    borderBottom: "2px solid #3f51b5", borderTop: "2px solid #3f51b5"


                }}


            >
               <h3> <strong>Patient Table (Add Icon)</strong> </h3>
            </TableCell>
        <TableRow>
            <TableCell

                style={{
                    borderBottom: "2px solid #3f51b5", borderTop: "2px solid #3f51b5", width: "500px"


                }}


            >
            </TableCell>
        </TableRow>
    </TableHead>
    <TableBody>
    {rows.map((row) => (
            <TableRow
              key={row.name}
              sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
            >
              <TableCell component="th" scope="row">
                {row.name}
              </TableCell>
              <TableCell align="right">{row.calories}</TableCell>
              <TableCell align="right">{row.fat}</TableCell>
              <TableCell align="right">{row.carbs}</TableCell>
              <TableCell align="right">{row.protein}</TableCell>
            </TableRow>
          ))}
    </TableBody>
</Table>
</TableContainer>

        </div>
    )
}
